import React from 'react';
import Layout from './layout.js'

const Index = (props) => {
    return (
        <div>
            {
                props.spaces.map( spaceData => {
                    return <div style={{ display : "grid", gridTemplateColumns: "repeat(4, 1fr)", gridGap: 20 }}>
                        <div>
                            <img src={spaceData.links.mission_patch_small} alt="Mountains" />
                            <h4>{spaceData.mission_name}</h4>
                            <p>Mission Ids: {spaceData.mission_id}</p>
                            <p>Launch Year: {spaceData.launch_year}</p>
                            <p>sucessfull Launch: {spaceData.launch_success}</p>
                            <p>sucessfull Landing: {spaceData.rocket.first_stage.cores[0].land_success}</p>
                        </div>
                    </div>
                })
            }
        </div>
    );
}
export const getStaticProps = async () => {
    const res = await fetch('https://api.spacexdata.com/v3/launches?limit=100')
    const spaces = await res.json()
    return {
        props: {
            spaces
        },
    }
  }

export default Index;
